"   </div>",
"   <div class=\"lgnd\">",
"    The medial epicondyle is palpated for tenderness with the elbow flexed at 90 degrees. Local tenderness is a hallmark feature of medial epicondylitis.",
"    <div class=\"footnotes\">",
