var script_f40_20_41293=[""].join("\n");
var outline_f40_20_41293=null;
var title_f40_20_41294="AIM 75_9";
var content_f40_20_41294=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F67985&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F67985&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Doxorubicin (Adriamycin), ifosfamide, and mesna (AIM 75/9) for advanced soft tissue sarcoma and as neoadjuvant chemotherapy for primary high-grade extremity soft tissue sarcoma",
"    <sup>",
"     [1]",
"    </sup>",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"4\" width=\"25%\">",
"     </colgroup>",
"     <tbody>",
"      <tr class=\"divider_bottom\">",
"       <td colspan=\"4\">",
"        Cycle duration: 21 days.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Drug",
"       </td>",
"       <td class=\"subtitle1\">",
"        Dose and route",
"       </td>",
"       <td class=\"subtitle1\">",
"        Administration",
"       </td>",
"       <td class=\"subtitle1\">",
"        Given on days",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Doxorubicin",
"        </strong>",
"       </td>",
"       <td>",
"        25 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        per day IV",
"       </td>",
"       <td>",
"        Dilute with 50 mL normal saline (NS) or 5 percent dextrose in water (D5W) and administer over one to five minutes.",
"       </td>",
"       <td>",
"        Days 1, 2, and 3",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Ifosfamide",
"        </strong>",
"       </td>",
"       <td>",
"        2000 to 3000 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        per day IV*",
"       </td>",
"       <td>",
"        Dilute with 250 to 500 mL of NS or D5W to a final concentration of 0.6 to 20 mg/mL and administer over three hours daily.",
"       </td>",
"       <td>",
"        Days 1, 2, and 3",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Mesna",
"        </strong>",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"       <td>",
"        1200 to 1800 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        per day IV (60 percent of the total daily ifosfamide dose), given in three divided doses",
"       </td>",
"       <td>",
"        Dilute one-third of the total daily dose in NS or D5W (total concentration of mesna should not exceed 20 mg/mL) and administer over 15 minutes prior to each daily dose of ifosfamide. Repeat at four and eight hours after the initiation of each dose of ifosfamide daily.",
"       </td>",
"       <td>",
"        Days 1, 2, and 3",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Pretreatment considerations:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Hydration:",
"        </strong>",
"        Adequate hydration (at least two liters of oral or IV fluids per day) should be maintained with ifosfamide to reduce the risk of bladder toxicity",
"        <sup>",
"         [2]",
"        </sup>",
"        . Refer to UpToDate topic on \"Cystitis in patients with cancer\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Emesis risk:",
"        </strong>",
"        HIGH (&gt;90 percent risk of emesis). Refer to UpToDate topic on \"Prevention and treatment of chemotherapy-induced nausea and vomiting\". Concomitant administration of aprepitant may increase the risk of ifosfamide neurotoxicity",
"        <sup>",
"         [3-5]",
"        </sup>",
"        ; its use is avoided at some institutions.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Prophylaxis for infusion reactions:",
"        </strong>",
"        There is no standard premedication regimen. Refer to UpToDate topic on \"Infusion reactions to systemic chemotherapy\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Vesicant/irritant properties:",
"        </strong>",
"        Doxorubicin is a vesicant; avoid extravasation. Refer to UpToDate topic on \"Extravasation injury from chemotherapy and other non-neoplastic vesicants\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Infection prophylaxis:",
"        </strong>",
"        The incidence of febrile neutropenia was not reported in the study; however, severe neutropenia is a frequent adverse event",
"        <sup>",
"         [1]",
"        </sup>",
"        . Primary prophylaxis with hematopoietic growth factors should be considered on an individual basis, particularly for high-risk patients such as those with preexisting neutropenia, advanced disease, poor performance status, or age over 50 years. Refer to UpToDate topic on \"Use of granulocyte colony stimulating factors in patients with chemotherapy-induced neutropenia\").",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Dose adjustment for baseline liver or renal dysfunction:",
"        </strong>",
"        A lower initial ifosfamide dose may be needed for patients with preexisting renal or liver impairment. A lower starting dose of doxorubicin may be needed for patients with preexisting liver impairment",
"        <sup>",
"         [6]",
"        </sup>",
"        . Refer to UpToDate topic on \"Chemotherapy hepatotoxicity and dose modification in patients with liver disease\" and \"Chemotherapy-related nephrotoxicity and dose modification in patients with renal insufficiency\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Cardiac issues:",
"        </strong>",
"        Doxorubicin is associated with cardiomyopathy, the incidence of which is related to the cumulative dose. Assess baseline LVEF prior to administration. Doxorubicin is contraindicated for patients with recent myocardial infarction, severe myocardial dysfunction, severe arrhythmia, or previous therapy with high cumulative doses of doxorubicin or any other anthracyclines",
"        <sup>",
"         [6]",
"        </sup>",
"        . Refer to UpToDate topic on \"Cardiotoxicity of anthracycline-like chemotherapy agents\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Monitoring parameters:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; CBC with differential and platelet count weekly during treatment.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; Ifosfamide is associated with cumulative nephrotoxicity, mostly at a total dose above 60 grams/m",
"        <sup>",
"         2",
"        </sup>",
"        . Clinical manifestations may include hypophosphatemia, renal potassium wasting, metabolic acidosis with a normal ion gap, and rarely, polyuria due to nephrogenic diabetes insipidus. Assess creatinine and electrolytes, including potassium and phosphate, daily during treatment and prior to each subsequent treatment cycle. Refer to UpToDate topic on \"Ifosfamide nephrotoxicity\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; Mesna does not prevent hemorrhagic cystitis in all patients",
"        <sup>",
"         [7]",
"        </sup>",
"        . Monitor a morning specimen of urine for hematuria daily, on days 1 through 3. Refer to UpToDate topic on \"Cystitis in patients with cancer\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; Monitor for ifosfamide neurotoxicity (confusion, coma, rarely seizures, weakness, neuropathy, ataxia, cranial nerve dysfunction) daily days 1 to 3. Central nervous system side effects may be especially problematic for those over age 60. Refer to UpToDate topic on \"Neurologic complications of non-platinum cancer chemotherapy\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; Assess liver function tests prior to each treatment cycle.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; Monitor cumulative doxorubicin dose. Reassess LVEF periodically during therapy as clinically indicated.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Suggested dose alterations for toxicity:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Myelotoxicity:",
"        </strong>",
"        No defined dose alterations for myelosuppression were outlined in this study",
"        <sup>",
"         [1]",
"        </sup>",
"        . However, treatment should be delayed until white blood cell count is &gt;4000 cells/mm",
"        <sup>",
"         3",
"        </sup>",
"        and platelet count is &gt;100,000/mm",
"        <sup>",
"         3",
"        </sup>",
"        . Reduce doses of ifosfamide and doxorubicin by 25 percent for failure to recover platelets to &gt;100,000/mm",
"        <sup>",
"         3",
"        </sup>",
"        by day 28, or for grade 4 neutropenia or febrile neutropenia despite prophylaxis with hematopoietic growth factors, or for platelet count &lt;50,000/mm",
"        <sup>",
"         3",
"        </sup>",
"        during any cycle.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Neurologic toxicity:",
"        </strong>",
"        Although formal guidelines are not provided by the manufacturer, ifosfamide dose adjustment (lower dose, or administering the same dose over a greater number of days) should be considered for patients with reversible grade 2 or 3 neurologic toxicity",
"        <sup>",
"         [2]",
"        </sup>",
"        . Discontinue for &ge;grade 3 toxicity. Refer to UpToDate topic on \"Neurologic complications of non-platinum cancer chemotherapy\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Bladder toxicity:",
"        </strong>",
"        For microscopic hematuria (greater than 10 RBC per high power field), withhold ifosfamide until complete resolution. Although formal guidelines are not available, ifosfamide dose adjustment may be needed for patients with grade 3 or worse urotoxicity that has not responded to increases in IV fluids or mesna",
"        <sup>",
"         [2]",
"        </sup>",
"        .",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Renal toxicity:",
"        </strong>",
"        A 50 percent reduction in ifosfamide dose is suggested for creatinine increase up to 1.5 times ULN during therapy, with treatment discontinuation for any increase &gt;1.5 times ULN",
"        <sup>",
"         [8]",
"        </sup>",
"        . In addition, for patients with a normal baseline serum creatinine level, reduce ifosfamide dose for a day 1 serum creatinine of 1.8 mg/dL or greater. Refer to UpToDate topic on \"Ifosfamide nephrotoxicity\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"4\">",
"        <strong>",
"         If there is a change in body weight of at least 10 percent, doses should be recalculated.",
"        </strong>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <strong>",
"     This table is provided as an example of how to administer this regimen; there may be other acceptable methods. This regimen must be administered by a clinician trained in the use of chemotherapy. The clinician is expected to use his or her independent medical judgment in the context of individual circumstances to make adjustments, as necessary.",
"    </strong>",
"    <div class=\"footnotes\">",
"     IV: intravenous; LVEF: left ventricular ejection fraction; CBC: complete blood count; RBC: red blood cells; ULN: upper limit of normal.",
"     <br/>",
"     * The ifosfamide dose (6000 or 9000 mg/m",
"     <sup>",
"      2",
"     </sup>",
"     per cycle) should be chosen based upon clinical judgment. While generally well tolerated, AIM chemotherapy may be associated with severe, potentially fatal neutropenia, thrombocytopenia, and anemia as well as nephrotoxicity and neurotoxicity. A lower dose of ifosfamide may be preferred for patients over the age of 60",
"     <sup>",
"      [2]",
"     </sup>",
"     .",
"     <br/>",
"     &Delta; If necessary, oral mesna may be used; however, oral mesna is not recommended for the initial dose",
"     <sup>",
"      [9]",
"     </sup>",
"     . If the oral route is chosen, patients should receive an initial IV dose of mesna (at 20 percent of the daily dose of ifosfamide) prior to the day 1 ifosfamide administration, followed by oral mesna tablets at 40 percent of the daily ifosfamide dose per dose, administered at two and six hours after the initiation of each dose of ifosfamide. This same dosing schedule is repeated on each day that ifosfamide is administered. The total daily mesna dose is 100 percent of the ifosfamide dose when the oral route is used. If patients vomit within two hours of taking a dose of mesna, they should repeat the dose or receive an IV dose of mesna",
"     <sup>",
"      [10]",
"     </sup>",
"     .",
"    </div>",
"    <div class=\"reference\">",
"     References:",
"     <br/>",
"     <ol>",
"      <li>",
"       Grobmyer SR, et al. Ann Oncol 2004; 15:1667.",
"      </li>",
"      <li>",
"       IFEX (ifosfamide) injection. US FDA-approved package insert. US National Library of Medicine. (Available online at dailymed.nlm.nih.gov, accessed January 3, 2012).",
"      </li>",
"      <li>",
"       Durand JP, et al. Ann Oncol 2007; 18:808.",
"      </li>",
"      <li>",
"       Jarkowski A. Am J Health-Syst Pharm 2008; 65:2229.",
"      </li>",
"      <li>",
"       Howell JE, et al. J Oncol Pharm Practice 2008; 14:157.",
"      </li>",
"      <li>",
"       Adriamycin (doxorubicin hydrochloride) injection. US FDA-approved package insert. US National Library of Medicine. (Available online at dailymed.nlm.nih.gov, accessed January 3, 2012).",
"      </li>",
"      <li>",
"       MESNA injection (solution). US FDA-approved package insert. US National Library of Medicine. (Available online at dailymed.nlm.nih.gov, accessed January 3, 2012).",
"      </li>",
"      <li>",
"       Worden FP, et al. J Clin Oncol 2005; 23:105.",
"      </li>",
"      <li>",
"       Hensley ML, et al. J Clin Oncol 2009; 27:127.",
"      </li>",
"      <li>",
"       MESNEX (mesna) tablets. US FDA-approved package insert. US National Library of Medicine. (Available online at dailymed.nlm.nih.gov, accessed January 3, 2012).",
"      </li>",
"     </ol>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
